            hashimoto(hash, nonce, uint64(size), cache, rootHash, proofs);
        uint256 target = MAX256 / difficulty; // target = (2**256)/difficult;
        target += ((MAX256 % difficulty) + 1) / difficulty;
        return
            mix == bytes32(mixHash) &&
            difficulty > 1 &&
            target > uint256(_diff);
    }
}
